configure:
  commands:
    end:
      new_state: execute
    ip msdp peer 172.16.254.2 connect-source Gi3/0/21 remote-as 65001: "ip msdp peer\
      \ 172.16.254.2 connect-source Gi3/0/21 remote-as 65001\r\n"
    ip msdp peer 172.16.254.2 remote-as 65001: "ip msdp peer 172.16.254.2 remote-as\
      \ 65001\r\n"
    line console 0:
      new_state: configure_line
    no logging console: ''
  prompt: stack3-nyquist-1(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: stack3-nyquist-1(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: stack3-nyquist-1#
